    <div className={styles.scenes}>
      <ul className={styles.scenes__list}>
        <li
          className={styles.scenes__item}
          onClick={() => dispatch(changeScene("Forest"))}
        >
          <img
            src="/assets/images/Forest.png"
            alt="List icon"
            className={styles.scenes__image}
