          />
        </li>
        <li
          className={styles.scenes__item}
          onClick={() => dispatch(changeScene("Aqua"))}
        >
          <img
            src="/assets/images/Aqua.jpg"
            alt="List icon"
            className={styles.scenes__image}
          />
        </li>
        <li
          className={styles.scenes__item}
