            alt="List icon"
            className={styles.scenes__image}
          />
        </li>
        <li
          className={styles.scenes__item}
          onClick={() => dispatch(changeScene("Sunshine"))}
        >
          <img
            src="/assets/images/Sunshine.jpg"
            alt="List icon"
            className={styles.scenes__image}
          />
        </li>
      </ul>
    </div>
  );
}

